import React from "react";

import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

import Auth from '../pages/Auth';
import Header from "./Header";
import Footer from "./Footer";
import Notes from '../pages/Notes';

function App() {

  return (
    <div>
      <Router>
        <Header />
        <Switch>
          <Route>
            <Notes />
          </Route>
          <Route>
            <Auth />
          </Route>
          <Footer />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
